JPQL - How can i search entities for key and value (Hibernate OGM (MongoDB) - Map<String, String>)<p>I use Hibernate OGM for MongoDB, and mapping simple ShopItem entity with Map:</p>

<pre><code>@NamedQueries({
        @NamedQuery(name = ShopItem.GET_BY_NAME,
                    query = "select items from ShopItem items where 
                    items.name=:name"),
        @NamedQuery(name = ShopItem.GET_BY_OPTION,
                query = "select items from ShopItem items 
                        join items.options map 
                where ( KEY(map) = :optionKey and map = :optionValue )")
})
@Entity
public class ShopItem {

    public static final String GET_BY_NAME = "ShopItem.getByName";
    public static final String GET_BY_OPTION = "ShopItem.getByOption";

    @Id
    @GeneratedValue(generator = "uuid")
    @GenericGenerator(name = "uuid", strategy = "uuid2")
    private String id;

    private String name;

    @ElementCollection(fetch = FetchType.EAGER)
    private Map&lt;String, String&gt; options = new HashMap&lt;&gt;();
    //...etc
}
</code></pre>

<p>This mapped good. And I tried write JPQL named queries for my ShopItemRepository. I've searched NamedQuery by field 'name' and it works fine. But I need to search by both fields 'key' and 'value' and I can't write correct JPQL for this. 
For example i have entity in db:</p>

<pre><code>{
   "_id":"df111b8a-b831-4200-95b3-f80576cd7273",
   "name":"Example",
   "description":"My description",
   "options":
        {
            "weight":"60 kg",
            "age":"22"
        }
}
</code></pre>

<p>And i want find all entities where options have key 'age' and have value '22'.</p>

<p>I try to write:</p>

<pre><code>select items from ShopItem items join items.options map where ( KEY(map) = :optionKey and map = :optionValue )
</code></pre>

<p>or</p>

<pre><code>select items from ShopItem items join items.options map where ( KEY(map) = :optionKey and :optionValue in (VALUE(map))
</code></pre>

<p>or</p>

<pre><code>select items from ShopItem items where ( KEY(items.options) = :optionKey and items.options = :optionValue )
</code></pre>

<p>or</p>

<pre><code>select items from ShopItem items where ( KEY(items.options) = :optionKey and :optionValue in (VALUE(items.options))
</code></pre>

<p>And have this error</p>

<pre><code>org/hibernate/hql/ast/origin/hql/resolve/GeneratedHQLResolver.g: node from line 1:85 no viable alternative at input '('

can't look backwards more than one token in this stream
</code></pre>

<p>My code in repo:</p>

<pre><code>List&lt;ShopItem&gt; result = entityManager.createNamedQuery(ShopItem.GET_BY_OPTION, ShopItem.class)
                .setParameter("optionKey", key)
                .setParameter("optionValue", value)
                .getResultList();

</code></pre>

<p>Can you help me write correct JPQL query? And if this is not possible, then suggest how to do it another way.</p>

<p>I can't use Spring Data JPA.</p>

